import React from 'react';
import '../styles/styles.css';
import '../styles/Home.css';

const Home = () => {
  return (
    <div className="home-container" style={{ padding: '20px', backgroundColor: '#f0f0f0' }}>
      <h1 className="home-title" style={{ color: '#333', textAlign: 'center' }}>Welcome to Home Page</h1>
      <p className="home-description" style={{ fontSize: '18px', lineHeight: '1.6' }}>This is the home page of our application.</p>
      
      <section className="process-section" style={{ marginTop: '40px' }}>
        <h2 className="process-title" style={{ color: '#555' }}>Our Process</h2>
        <div className="process-steps" style={{ display: 'flex', justifyContent: 'space-around' }}>
          <div className="process-step" style={{ flex: '1', margin: '10px', padding: '20px', border: '1px solid #ddd', borderRadius: '8px' }}>
            <h3 style={{ color: '#777' }}>Step 1: Sign Up</h3>
            <p>Create an account to get started.</p>
          </div>
          <div className="process-step" style={{ flex: '1', margin: '10px', padding: '20px', border: '1px solid #ddd', borderRadius: '8px' }}>
            <h3 style={{ color: '#777' }}>Step 2: Customize</h3>
            <p>Personalize your experience.</p>
          </div>
          <div className="process-step" style={{ flex: '1', margin: '10px', padding: '20px', border: '1px solid #ddd', borderRadius: '8px' }}>
            <h3 style={{ color: '#777' }}>Step 3: Enjoy</h3>
            <p>Start using our application and enjoy the benefits.</p>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
